import { useState } from "react";

function Contact(){
    const[name,setName] =useState("");
    const handleSubmit = (event)=> {
        event.preventDefault();
        alert(`name: ${name}`)
    }
    return (

        <form onSubmit={handleSubmit}>
            <label>Enter your name:
                <input 
                type="text"
                value={name}
                onChange={(e) => setName(e.target.value)}/>
            </label>
            <input type="submit"/>
        </form>
    )
};
export default Contact;
